import React from 'react';
import { useHistory } from 'react-router-dom'; // Import useHistory for navigation
import './LandingPage.css';
import heroImage from '../../assets/landing_hero.png'; // Importing the image

const LandingPage = () => {
  const history = useHistory(); // Initialize useHistory

  const handleAddToEstimateClick = () => {
    history.push('/calculator'); // Navigate to Calculator page
  };

  return (
    <div className="landing-page">
      <div className="text-content">
        <h1>Welcome to Google Cloud's </h1>
        <h2>Get started with your estimate</h2>
        <p>Add and configure products to get a cost <br /> estimate to share with your team.</p>
        <div className="button-container">
          <button className="add-button" onClick={handleAddToEstimateClick}>+ Add to Estimate</button>
        </div>
      </div>
      <div className="image-content">
        <img
          src={heroImage}
          alt="Hero"
          className="logo"
          style={{ height: '300px', width: '268px', marginLeft: '-40px' }}
        />
      </div>
    </div>
  );
};

export default LandingPage;
